const express = require('express');
const app = express();
const PORT = 8000;




app.get('/profile/:username', (req, res) => {
    const { username } = req.params;
    res.json({
        username:username,
        followingCount: 10,
        followerCount: 15,
        profilePicture: 'https://t4.ftcdn.net/jpg/00/64/91/37/240_F_64913707_PNS2WMobSFvvUgZrr4LuXbPUmpTSlBl1.jpg',
        posts: [
            {
                img:'data:image/jpeg;base64,',
                id:3
            },
            {
                img:'data:image/jpeg;base64,',
                id:3
            },
            {
                img:'data:image/jpeg;base64,',
                id:3
            }
        ]
    })
});




app.listen(PORT, () => {
    console.log(`Server is running on http://localhost:${PORT}`);
});